import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awExtTooltipRenderFunction } from 'js/ExtendedTooltipDefaultService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/ExtendedTooltipDefaultService', () => import('js/ExtendedTooltipDefaultService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awExtTooltipRenderFunction",
            "deps": "js/ExtendedTooltipDefaultService"
        }
    },
    "data": {
        "command": {
            "tooltip": "{{subPanelContext.title}}",
            "description": "{{subPanelContext.description}}"
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "ExtendedTooltipDefault",
    "_uniqueViewModelId": "ExtendedTooltipDefault",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awExtTooltipRenderFunction, undefined, ctxImportObj );

export default Component;
